(function(){$(function(){var b,a;b=$("#tooltip-box");a=$(".tooltip");a.live("mouseover",function(){b.html($(this).data("tooltip"));return b.show()});a.live("mouseout",function(){return b.hide()});return a.live("mousemove",function(a){b.css({top:a.pageY+12});return b.css({left:a.pageX+12})})})}).call(this);
